INSERT INTO zn_zi VALUES('易','11915',NULL,'yi4','8',NULL,NULL,'Y',NULL,'HSK_1-Common-06',replace('在古汉语中，「易」字有“边界”的意思。例如，在《荀子·富国》中，有“至于疆易”的句子，其中「疆」是“边疆”的意思，「易」是“边界”的意思，合起来表示“边疆的边界”。\n\n埸字的“易”字正是取自古汉语中的“边界”之意。因此，埸字可以理解为“平坦空地的边界”。\n\n易经的核心思想是“易”。易有三义：\n\n简易：易经的卦象和爻象都是由简单的阴阳符号构成的，但却蕴含着深刻的哲理。\n变易：易经认为，万事万物都在不断地变化之中，没有恒常不变的东西。\n不易：易经也认为，在变化之中，也存在着一些不变的规律。\n易经对中国传统文化产生了深远的影响，在哲学、宗教、政治、军事、文学、艺术等领域都有着广泛的应用。它是中华民族智慧的结晶，也是世界文化遗产的重要组成部分。\n','\n',char(10)),'',' change / easy / transform / trade / amiable /to exchange/prefix corresponding to the English adjective suffix ""-able"" or ""-ible"""','2024-02-27 18:32:38',1063.0,'Y',NULL,NULL,'300',NULL,'https://baike.baidu.com/item/%25E6%2598%2593/416877','233');
