INSERT INTO zn_zi VALUES('炁','8344',NULL,'qi4','8','氣',NULL,NULL,NULL,'HSK_z',NULL,NULL,'variant of 餼|氣|气[qi4], breath/air/steam/gas/weather/used in Taoist charms','2024-09-01 22:13:23',8241.0,'Y',NULL,'Y','0',NULL,replace('https://baike.baidu.com/item/%E7%82%81/6648802\n\n炁（qì）是古代汉字，本作气，隶变时气取代，而原本气字之意義由餼表達。最早是雲氣的意思，是象形字，有呼吸、氣息的意思，也有米飯的意思。後引申出天氣、氣候、節氣、氣味乃至於風氣、流行等意思。\n\n至宋代之後，道教思想家為了區別先天的氣與後天的氣，採用古字「炁」來代表先天的氣，代表無極，氣則被當成是後天的氣，為太極。這兩個字的意義又被分開。\n\n因此，炁在道教中代表著先天之氣，是萬物之本，是宇宙的本源。它是無形無相的，但卻是充滿宇宙的。炁是生命的源泉，是萬物生長的動力。\n\nhttps://www.wikiwand.com/zh/%E6%B0%A3_(%E4%B8%AD%E5%9C%8B)\n\nhttps://baike.baidu.com/item/%E7%82%81/6648802\n\n','\n',char(10)),'0');
